import {Box, Button, CloseButton, Heading} from "@chakra-ui/react";

function TaskPage() {
    return (
        <Box p={15} maxW="md" mx="auto">
            <Heading
                mb={"6"}
                textAlign={"center"}
                color={"green.500"}
            >
                Tasks
            </Heading>

            <Fieldset.Root>
                <Stack>
                    Fieldset.Legend>
                    
                </Stack>
            </Fieldset.Root>



        </Box>
    );
}

export default TaskPage
